package org.opentripplanner.routing.patch;import java.io.Serializable;public class Entry implements Serializable {    private static final long serialVersionUID = -2026335084427623584L;    private String key = null;    private String value = null;    public Entry(String key, String value) {        this.key = key;        this.value = key;    }    public Entry() {    }    public Entry(String value) {        this.value = value;    }    public String getKey() {        return this.key;    }    public void setKey(String key) {        this.key = key;    }    public String getValue() {        return this.value;    }    public void setValue(String value) {        this.value = value;    }}